import React from 'react';
import GameItem from './gameItem'

class Games extends React.Component{

    render(){
        return this.props.myMovies.map((movie)=>{
            //console.log({movie});
            return <MovieItem key={movie._id} movie={movie}></MovieItem>
        });
    }
}
export default Games;
